import React from "react";
import "../UserProfileRecipesListStyle.css";
import moment from "moment";

const UserProfileListRecipes = ({
  tasks,
  toggleEditModal,
  toggleDeleteModal,
}) => {
  return (
    <>
      <h2>Моите рецепти</h2>

      <table className="task">
        <thead>
          <tr>
            <th>Id</th>
            <th>Title</th>
            <th>Date</th>
            <th style={{ width: 250 }}>Options</th>
          </tr>
        </thead>
        <tbody>
          {tasks.map((task, index) => {
            return (
              <tr style={{ fontSize: 20, padding: 15 }} key={index}>
                <td> {task.id}</td>
                <td> {task.title}</td>
                <td>
                  {task.Date === null
                    ? ""
                    : moment.unix(task.Date).format("DD.MM.YYYY")}
                </td>
                <td>
                  <button
                    className="delete"
                    onClick={() => toggleDeleteModal(task.id)}
                  >
                    Delete
                  </button>
                  <button
                    className="edit"
                    onClick={() => toggleEditModal(task.id)}
                  >
                    Edit
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </>
  );
};

export default UserProfileListRecipes;
